import React from 'react';
import { NavItem } from 'reactstrap';
import { NavLink } from 'react-router-dom';

const SignedInLinks = () => {
    return (
            <NavItem><NavLink tag={Link} to='/'>Felhasználók</NavLink></NavItem>
    )
}

export default SignedInLinks;
